$(document).ready(function () {
    var humo = `
        <rect rx="50" fill="url(#pattern0)"/>
        <rect class="cardLogo" fill="url(#pattern1)"/>
        <defs>
        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlink:href="#image0" transform="translate(-0.382794) scale(0.000929257 0.00166667)"/>
        </pattern>
        <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlink:href="#image1" transform="scale(0.00115875 0.00190114)"/>
        </pattern>
        <image id="image0" width="1900" height="600" xlink:href="data:image/jpeg;base64,"/>
        <image id="image1" width="163" height="226" xlink:href="data:image/png;base64,"/>
        </defs>
    `;

    var uzcard = `<rect rx="50" fill="url(#paint0_linear)"/>
    <rect class="cardLogo" rx="7.5" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0" transform="translate(0 0) scale(0.00119366 0.00202451)"/>
    </pattern>
    <linearGradient id="paint0_linear" x1="290" y1="-3.06799e-06" x2="610" y2="632" gradientUnits="userSpaceOnUse">
    <stop stop-color="#262F56"/>
    <stop offset="0.466083" stop-color="#192452"/>
    <stop offset="1" stop-color="#262F56"/>
    </linearGradient>
    <image id="image0" width="163" height="200" xlink:href="data:image/png;base64,"/>
    </defs>`;

    var defaultCard = `<g id="default">
            <g id="Page-1_1_">
                <g id="amex_1_">
                    <path id="Rectangle-1_1_" class="lightcolor grey" d="M40,0h670c22.1,0,40,17.9,40,40v391c0,22.1-17.9,40-40,40H40c-22.1,0-40-17.9-40-40V40 C0,17.9,17.9,0,40,0z" />
                </g>
            </g>
            <path class="darkcolor greydark"
                d="M750,431V193.2c-217.6-57.5-556.4-13.5-750,24.9V431c0,22.1,17.9,40,40,40h670C732.1,471,750,453.1,750,431z" />
        </g>`;

    $("#cardNumber").keypress(function (e) {
        e.stopImmediatePropagation();
        var cardNumberLabel = $(this).val();

        var key = e.which || e.charCode || e.keyCode || 0;

        if (e.charCode < 48 || e.charCode > 57) {
            return false;
        } else {
            if (key !== 8 && key !== 9) {
                if (cardNumberLabel.length === 4) {
                    $(this).val($(this).val() + " ");
                }
                if (cardNumberLabel.length === 9) {
                    $(this).val($(this).val() + " ");
                }
                if (cardNumberLabel.length === 14) {
                    $(this).val($(this).val() + " ");
                }
            }
        }
    });
    $("#cardNumber").keyup(function () {
        $("#svgnumber").text($(this).val());

        if ($("#svgnumber").text().length == 0) {
            $("#svgnumber").text("0000 0000 0000 0000");
        }
        if ($(this).val() !== "") {
            if ($(this).val().startsWith("860")) {
                $("#CardBackground").html(uzcard);
                $("#cardNumber").css({
                    border: "1px solid transparent",
                });
                $("#card-error").fadeOut();
            } else if ($(this).val().startsWith("986")) {
                $("#CardBackground").html(humo);
                $("#cardNumber").css({
                    border: "1px solid transparent",
                });
                $("#card-error").fadeOut();
            } else {
                $("#CardBackground").html(defaultCard);
                $("#cardNumber").css({
                    border: "1px solid red",
                });
                $("#card-error").fadeIn();
            }
        }
    });

    $("#expireDate").keypress(function (e) {
        e.stopImmediatePropagation();

        var key = e.which || e.charCode || e.keyCode || 0;

        if (e.charCode < 48 || e.charCode > 57) {
            return false;
        } else {
            if (key !== 8 && key !== 9) {
                if ($(this).val().length === 2) {
                    if ($(this).val() > 12 || $(this).val() < 1) {
                        $("#expire-error").fadeIn();
                    } else {
                        $("#expire-error").fadeOut();
                    }
                    $(this).val($(this).val() + "/");
                }
            }
        }
    });

    $("#expireDate").keyup(function (e) {
        $("#svgexpire").text($(this).val());
        if ($("#svgexpire").text().length == 0) {
            $("#expisvgexpireesLabel").text("00/00");
        }
    });

    var regex = new RegExp("^[a-zA-Z]{2}[0-9]{7}$");

    $("#passportID").on("keydown", function (e) {
        var key = e.which || e.charCode || e.keyCode || 0;
        var value = $(this).val();
        if (key !== 8 && key !== 9) {
            if (value.length < 2) {
                if (key < 65 || key > 90) {
                    e.preventDefault();
                }
            }
            if (value.length > 1) {
                if (key < 48 || key > 57) {
                    e.preventDefault();
                }
            }
        }
    });

    $("#pinfl").keypress(function (e) {
        e.stopImmediatePropagation();

        var key = e.which || e.charCode || e.keyCode || 0;

        if (e.charCode < 48 || e.charCode > 57) {
            return false;
        }
    });

    $("#phone-number")
        .keydown(function (e) {
            var key = e.which || e.charCode || e.keyCode || 0;
            $phone = $(this);

            // Don't let them remove the starting '('
            if ($phone.val().length === 1 && (key === 8 || key === 46)) {
                $phone.val("(");
                return false;
            }
            // Reset if they highlight and type over first char.
            else if ($phone.val().charAt(0) !== "(") {
                $phone.val("(" + String.fromCharCode(e.keyCode) + "");
            }

            // Auto-format- do not expose the mask as the user begins to type
            if (key !== 8 && key !== 9) {
                if ($phone.val().length === 3) {
                    $phone.val($phone.val() + ")");
                }
                if ($phone.val().length === 4) {
                    $phone.val($phone.val() + " ");
                }
                if ($phone.val().length === 8) {
                    $phone.val($phone.val() + "-");
                }
                if ($phone.val().length === 11) {
                    $phone.val($phone.val() + "-");
                }
            }

            // Allow numeric (and tab, backspace, delete) keys only
            return (
                key == 8 ||
                key == 9 ||
                key == 46 ||
                (key >= 48 && key <= 57) ||
                (key >= 96 && key <= 105)
            );
        })

        .bind("focus click", function () {
            $phone = $(this);

            if ($phone.val().length === 0) {
                $phone.val("(");
            } else {
                var val = $phone.val();
                $phone.val("").val(val); // Ensure cursor remains at the end
            }
        })

        .blur(function () {
            $phone = $(this);

            if ($phone.val() === "(") {
                $phone.val("");
            }
        });
});

$(document).ready(function () {
    if ($("#imgshow1").attr("src", " ")) {
        $("#imgshow1").hide();
    }
    $("#imgload1").change(function () {
        var mimeType = this.files[0].type;
        if (
            (this.files && this.files[0] && mimeType === "image/jpeg") ||
            mimeType === "image/jpg"
        ) {
            var reader = new FileReader();

            reader.onload = function (e) {
                $("#imgshow1").attr("src", e.target.result);
                $("#imgshow1").show();
            };
            reader.readAsDataURL(this.files[0]);
            $("#logo-label1").text(this.files[0].name);
            $(".logo-upload1 span").hide();
        } else {
            $(".logo-upload1 .error-image-msg").show();
            $("#imgload1").val("");
        }
    });
});

